import React, { useRef } from 'react';
import "./contact.css";
import emailjs from '@emailjs/browser';
import Instagram from "/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/src/components/ContactForm/Instagram.png"
import Github from "/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/src/components/ContactForm/github.png"
import Linkedin from "/Users/jarvis/Desktop/Porfolio/KESHAV'S portfolio/Portfolio/src/components/ContactForm/linkedin.png"

export const ContactUs = () => {
    const form = useRef();

    const sendEmail = (e) => {
        e.preventDefault();

        emailjs.sendForm('service_ud0u6a7', 'template_i7vauga', form.current, 'fLYLwy4PzgKnFSd7W')
            .then((result) => {
                console.log(result.text);
                console.log("message sent")
                alert("Message sent!");
            }, (error) => {
                console.log(error.text);
            });
    };

    return (
        <section className='contact_section'>
            <div className="container_contact">
                <div className="contactInfo">
                    <div>
                        <h2>Contact Info</h2>
                        <ul className="info">
                            <li>
                                <span><img src="#" alt="Location icon" /></span>
                                <span>New Delhi</span>
                            </li>
                            <li>
                                <span><img src="#" alt="Mail icon" /></span>
                                <span><a href="#">keshavdayal205@gmail.com</a></span>
                            </li>
                            <li>
                                <span><img src="#" alt="Call icon" /></span>
                                <span>+91-9958402122</span>
                            </li>
                        </ul>
                    </div>
                    <ul className="sci">
                       <li><a href="https://www.instagram.com/keshxvdayal/?hl=el"><img src="https://i.pinimg.com/originals/94/40/9a/94409a775c02d7658dd6e7ba88429b63.png" /></a></li>
                        <li><a href="https://twitter.com/nassosanagn"><img src={Github} alt="github.png" /></a></li>
                        <li><a href="https://www.linkedin.com/in/nassos-anagnostopoulos-2b9631196/"><img src={Linkedin} alt="LinkedIn icon" /></a></li>
                    </ul>
                </div>
                <div className="contactForm">
                    <h2>Send a Message</h2>
                    <form className="formBox" ref={form} onSubmit={sendEmail}>
                        <div className="inputBox w50" name="First Name">
                            <h3 className='form-h3'>First Name:</h3>
                        {/* <span>First Name</span> */}
                        <input type="text" name="user_name"/>
                        </div>
                        <div className="inputBox w50">
                        <h3 className='form-h3'>Last Name:</h3>
                        <input type="text" name="user_name" />
                        </div>
                        <div className="inputBox w50">
                        <h3 className='form-h3'>Email:</h3>
                        <input type="email" name="user_email" />
                        </div>
                        <div className="inputBox w100">
                        <h3 className='form-h3'>Message:</h3>
                        <textarea name="message" rows={40} cols={50} required/>
                        </div>
                        <div className="inputBox w100">
                        <input className="inputBox w100" type="submit" value="Send" />
                        </div>
                    </form>
                    </div>
                {/* </div> */}
            </div>
        </section>
    );
};

export default ContactUs
